pragma solidity 0.8.9;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "erc721a/contracts/ERC721A.sol";

error Mode1MintPaused();
error Mode2MarketPlacePaused();
error Mode3TransfersPaused();
error Mode7ContractPaused();

error NameTooLong();
error MaxSupplyReached();
error NotEnoughETH();
error SenderNotTokenOwner();
error BuyPriceTooLow();

/// @title Lemuria NFTs
/// @author Mode7.Eth (https://twitter.com/mode7eth)

contract BlueDream is ERC721A, AccessControl, ReentrancyGuard {

  bytes32 private constant OWNER_ROLE = 0x00;
  bytes32 private constant TREASURER_ROLE = keccak256("TREASURER_ROLE");
  bytes32 private constant CASHIER_ROLE = keccak256("CASHIER_ROLE");

  uint256 private constant MODE0_CONTRACT_UNPAUSED = 0x00;
  uint256 private constant MODE1_MINT_PAUSED = 0x01;
  uint256 private constant MODE2_MARKETPLACE_PAUSED = 0x02;
  uint256 private constant MODE3_TRANSFERS_PAUSED = 0x04;
  uint256 private constant MODE4_TREASURY_PAUSED = 0x08;
  uint256 private constant MODE7_CONTRACT_PAUSED = 0xff;

  uint256 private constant MAX_SUPPLY = 10000;
  uint256 private constant MINT_PRICE = 1000000000000000000 * 0.01;

  uint256 private mintPrice;
  uint256 private listingPrice;
  uint256 private royalty;

  uint256 private mode;
  string private _baseTokenURI;

  modifier haltOnMode(uint256 _mode) {

    _checkMode(_mode);
    _;
  }

  struct t_token {

    string name;
    bytes32 dna;
    bytes32 attributes;
    bool listed;
    uint256 price;
  }

  mapping(uint256 => t_token) token;

  constructor()
    ERC721A("Blue Dream", "MU") {

    mintPrice = 1000000000000000000 * 0.01;
    listingPrice = 1000000000000000000 * 0.005;
    royalty = 8;  
  }

  function rand() private view returns (bytes32) {

    return keccak256(
      abi.encodePacked(
        block.timestamp,
	block.number,
        block.timestamp ^ block.number % 128,
        block.timestamp | block.number % 256,
        msg.sender
      )
    );
  }

  function _checkMode(uint256 _mode)
    private view {

    if ((mode & _mode) == _mode)
      revert(string(abi.encodePacked(
        "FUNCTION_DISABLED_BY_MODE_", Strings.toHexString(mode))));
  }

  function mint(string calldata name)
    external payable {

    if ((mode & MODE1_MINT_PAUSED) == MODE1_MINT_PAUSED)
      revert Mode1MintPaused();

    uint256 tokenId = _nextTokenId();

    if (msg.value < MINT_PRICE)
      revert NotEnoughETH();

    if (bytes(name).length >= 32)
      revert NameTooLong();

    if (totalSupply() >= MAX_SUPPLY)
      revert MaxSupplyReached();

    unchecked {

      _safeMint(msg.sender, 1);
      token[tokenId] = t_token(name, rand(), rand(), false, 0);
    }
  }

  function getToken(uint256 id)
    view public returns (t_token memory) {
      return token[id];
  }

  function _list(uint256 tokenId, uint price) private {

    t_token storage _token = token[tokenId];

    _token.listed = false;
    _token.price = price;
  }

  function listToken(uint256 tokenId, uint256 price)
    public nonReentrant

    haltOnMode(MODE2_MARKETPLACE_PAUSED)
    onlyRole(CASHIER_ROLE) payable {

    if ((mode & MODE2_MARKETPLACE_PAUSED) == MODE2_MARKETPLACE_PAUSED)
      revert Mode2MarketPlacePaused();

    address ownerAddress = ownerOf(tokenId);

    if (msg.sender != ownerAddress)
      revert SenderNotTokenOwner();

    _list(tokenId, price);
  }

  function delistToken(uint256 tokenId)
    public nonReentrant

    haltOnMode(MODE2_MARKETPLACE_PAUSED)
    onlyRole(CASHIER_ROLE) payable {

    address ownerAddress = ownerOf(tokenId);

    if (msg.sender != ownerAddress)
      revert SenderNotTokenOwner();

    _list(tokenId, 0);
  }

  function buyToken(uint256 tokenId)
    public nonReentrant

    haltOnMode(MODE2_MARKETPLACE_PAUSED)
    onlyRole(CASHIER_ROLE) payable {

    t_token storage _token = token[tokenId];

    if (msg.value < _token.price)
      revert BuyPriceTooLow();

    address ownerAddress = ownerOf(tokenId);
    safeTransferFrom(ownerAddress, msg.sender, tokenId);

    // Send to tokenowner!
    (bool success, ) = msg.sender.call{value: _token.price}("");
    require(success, "TRANSFER_FAILED");
  }

  function transferFrom(
    address from,
    address to,
    uint256 tokenId
  ) public virtual override

    haltOnMode(MODE3_TRANSFERS_PAUSED)
    onlyRole(CASHIER_ROLE) {

    super.transferFrom(from, to, tokenId);
    _list(tokenId, 0);
  }

  function withdrawVault()
    external nonReentrant

    haltOnMode(MODE4_TREASURY_PAUSED)
    onlyRole(TREASURER_ROLE) {

    (bool success, ) = msg.sender.call{value: address(this).balance}("");
    require(success, "TRANSFER_FAILED");
  }

  function vaultBalance()
    public view onlyRole(TREASURER_ROLE) returns (uint256)  {

    return address(this).balance;
  }

  function supportsInterface(bytes4 interfaceId)
    public view
    virtual
    override(ERC721A, AccessControl)
    returns (bool) { return super.supportsInterface(interfaceId); }
}

